import HomePage from '../page/HomePage';
import SignUpPage from '../page/SignUpPage';
import DashPage from '../page/DashBoard'

const routerIndex = [
    {
        path: '/',
        exact: true,
        components: HomePage,
    },
    {
        path: '/register',
        exact: true,
        components: SignUpPage,
    },
    {
        path: '/admin',
        exact: true,
        components: DashPage,
    }
];

export default routerIndex;
